import react, { Fragment } from 'react';
import { Button, Table } from 'react-bootstrap';
import "bootstrap/dist/css/bootstrap.min.css";
import Employees from './Employees';
import { Link, NavLink, useNavigate } from 'react-router-dom'

function Home() {

    let history = useNavigate();

    const handleEdit = (id, name, contact, room, bill) => {
        localStorage.setItem('Name', name);
        localStorage.setItem('Contact', contact);
        localStorage.setItem('Room', room);
        localStorage.setItem('Bill', bill);
        localStorage.setItem('Id', id);


    }

    const handleDelete = (id) => {
        var index = Employees.map(function (e) {
            return e.id
        }).indexOf(id);

        Employees.splice(index, 1);

        history('/home')
    }

    const handleClick = () => {
        localStorage.clear();

        // window.location.reload();

    }

    return (
        <Fragment>

             {/* navbar start */}

             <nav className="navbar navbar-expand-md navbar-light bg-dark bg-gradient sticky-lg-top  ">
                <div className="container-fluid">

                    {/* navbar brand img start */}
                    <Link className="navbar-brand bg-imageFluid" to="/" >
                        <img style={{ height: "50px", width: "90%" }} src="https://cdn-icons-png.flaticon.com/512/2785/2785544.png" />
                    </Link>
                    {/* navbar brand img end*/}



                    {/* toggle button start */}
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    {/* toggle button end */}

                    {/* style={{ width: "auto", margin: "auto", height: "auto " }} */}


                    {/* heading start */}
                    <div className="nav-brand lead text-light" ><h1 id="heading"> Hospital Management System </h1></div>
                    {/* heading end */}


                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav ms-auto f-right mb-0">

                            <li className="nav-item m-auto f-right">
                                <Link className="nav-link " aria-current="page" >{ }</Link>
                            </li>

                            <li className="nav-item f-right m-auto">
                                {/* <NavLink className="btn btn-outline-dark btn-info" to="/" onClick={handleClick} role="button">Logout</NavLink> */}
                                <NavLink to="/" ><button class="btn btn-danger btn-md  " onClick={handleClick} type="submit" >Logout</button></NavLink>
                            </li>

                        </ul>

                    </div>
                </div>
            </nav>
            {/* navbar end */}

            {/* Hero Content Starts */}

            <section class="main_heading " id="Patient-list">
                <div class="text-center">
                    <h1 id="contactus" class="display-3">Patients List</h1>
                    <hr class="w-25  mx-auto bg-dark" style={{ height: "3px" }} />

                    <div style={{ margin: "10rem" }}>
                        <Table striped bordered hover size="sm">
                            <thead style={{ color: "#FFFFFF", backgroundColor: "#457" }}>
                                <tr>
                                    <th>
                                        Name
                                    </th>
                                    <th>
                                        Contact
                                    </th>
                                    <th>
                                        Room
                                    </th>
                                    <th>
                                        Bill
                                    </th>
                                    <th>
                                        Actions
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    Employees && Employees.length > 0
                                        ?
                                        Employees.map((item) => {
                                            return (
                                                <tr>
                                                    <td>
                                                        {item.Name}
                                                    </td>
                                                    <td>
                                                        {item.Contact}
                                                    </td>
                                                    <td>
                                                        {item.Room}
                                                    </td>
                                                    <td>
                                                        {item.Bill}
                                                    </td>
                                                    <td>
                                                        <Link to={'/edit '}>
                                                            <Button onClick={() => handleEdit(item.id, item.Name, item.Contact, item.Room, item.Bill)} style={{ color: "#FFFFFF", backgroundColor: "#457" }}>Edit</Button>
                                                        </Link>
                                                        &nbsp;
                                                        <Button onClick={() => handleDelete(item.id)} style={{ color: "#FFFFFF", backgroundColor: "#3E3A3A" }}>Delete</Button>
                                                    </td>
                                                </tr>
                                            )
                                        })
                                        :
                                        "No data available"
                                }
                            </tbody>
                        </Table>
                        <br>
                        </br>
                        <Link className='gap-2' to={"/add"}>
                            <Button size="lg" style={{ color: "#FFFFFF", backgroundColor: "#457" }}>Add</Button>
                        </Link>
                    </div>
                    </div>
            </section>

            {/* Hero Content Ends */}
        </Fragment>
    )
}

export default Home;
